		public Row AddItem(string item, int index)
		{
			Row result = Rows.Insert(index);
			if (item == null)
			{
				return result;
			}
			string[] array = item.Split(new char[1] { ClipSeparators[0] });
			int num = Math.Min(array.Length, Cols.Count);
			for (int i = 0; i < num; i++)
			{
				SetData(index, i, array[i], coerce: true);
			}
			return result;
		}

		public Row AddItem(object[] items, int rowIndex, int colIndex)
		{
			Row result = Rows.Insert(rowIndex);
			for (int i = 0; i < items.Length; i++)
			{
				int num = colIndex + i;
				if (num >= Cols.Count)
				{
					break;
				}
				SetData(rowIndex, num, items[i], coerce: true);
			}
			return result;
		}

